webpackJsonp([28240868352697],{1360:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/webcam-face-detection-spooky-goings-on/index.md absPath of file >>> MarkdownRemark",html:'<h3>... at MMT Digital.</h3>\n<p><a href="http://www.mmtdigital.co.uk/RVEc4d1cd790afe4ac4be58071a72c98148,,.aspx"><img src="/content/images/2009/10/halloween.jpg" alt="Augmented Reality Halloween" title="Augmented Reality Halloween"></a></p>\n<p>Here\'s a bit of Friday afternoon fun for you.  I was playing around with some Actionscript face detection libraries last night, combined them with a webcam, some dynamic overlays, and voila! Augmented Reality, and just in time for Halloween too.  You will need a webcam to <a href="http://www.mmtdigital.co.uk/RVEc4d1cd790afe4ac4be58071a72c98148,,.aspx">try it out</a> yourself, as it\'s just an early prototype, but we thought it was cool enough to stick on the company homepage for a short while.</p>\n<p><strong>Update:</strong> You can see a live version and download the source code, from <a href="http://www.psyked.co.uk/adobe/flash/webcam-face-detection-demo-now-with-source.htm">this post</a>.</p>',frontmatter:{title:"Webcam + face detection = Spooky goings on...",date:"October 23, 2009",tags:["flash","augmented-reality","halloween"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/imagesizer-0-5-3-is-now-available/",tags:["imagesizer","adobe","adobe-air","alchemy","getsatisfaction"],title:"ImageSizer 0.5.3 is now available!",image:null,date:"2009-10-16T08:13:35.000Z"}},next:{frontmatter:{path:"/blog/cool-actionscript-projects-to-try-out-if-you-havent-already/",tags:["actionscript","box2d","actionscript","collision-detection-kit","timeline","tweening"],title:"Cool ActionScript projects to try out, if you haven't already...",image:null,date:"2009-11-05T08:47:52.000Z"}}}}}});
